Property.Value:
BEGIN
    select * from dbo.Users where Email = @Email;
END

BEGIN
    SET NOCOUNT ON

    INSERT INTO dbo.Users
    (
        Email,
        Password,
        Salt,
        Username,
        FullName,
        CreatedAt,
        LastUpdate
    )
    VALUES
    (
        @Email,
        @Password,
        @Salt,
        @Username,
        @FullName,
        @CreatedAt,
        @LastUpdate
    )

END

