    @Email NVARCHAR(200),
    @Password NVARCHAR(200),
    @Salt NVARCHAR(40),
    @Username NVARCHAR(200),
    @FullName NVARCHAR(200),
    @CreatedAt DATETIME,
    @LastUpdate DATETIME
